import React from 'react';

// 내부에서 버튼과 텍스트 필드 컴포넌트 정의
const Button = ({ variant = "solid", size = "sm", className = "", children }) => {
  const baseClasses = "px-4 py-2 rounded font-medium";
  const variantClasses = variant === "solid" 
    ? "bg-blue-500 text-white" 
    : "bg-transparent border border-blue-500 text-blue-500";
  const sizeClasses = size === "sm" ? "text-sm" : "text-base";

  return (
    <button className={`${baseClasses} ${variantClasses} ${sizeClasses} ${className}`}>
      {children}
    </button>
  );
};

const Label = ({ htmlFor, children }) => (
  <label htmlFor={htmlFor} className="block text-gray-700 font-medium mb-2">
    {children}
  </label>
);

const Textarea = ({ id, rows, defaultValue }) => (
  <textarea id={id} rows={rows} defaultValue={defaultValue} className="w-full border rounded-md p-2" />
);

const Command = ({ children }) => (
  <div className="border rounded-lg shadow-md">
    {children}
  </div>
);

const CommandInput = ({ placeholder }) => (
  <input type="text" placeholder={placeholder} className="w-full border-b p-2" />
);

const CommandList = ({ children }) => (
  <div className="p-2">
    {children}
  </div>
);

const CommandEmpty = ({ children }) => (
  <div className="text-gray-500 text-center py-2">
    {children}
  </div>
);

const CommandGroup = ({ children }) => (
  <div>
    {children}
  </div>
);

const CommandItem = ({ children }) => (
  <div className="flex items-center justify-between p-2 border-b last:border-b-0">
    {children}
  </div>
);

export const Edit = () => {
  return (
    <div className="w-full bg-white">
      <header className="bg-gray-900 text-white py-4 px-6 flex justify-between items-center">
        <div className="flex items-center">
          <div className="w-8 h-8 mr-2 text-red-500">
            <svg width="24" height="24" fill="currentColor" viewBox="0 0 24 24">
              <path d="M11.99 0C5.373 0 0 5.373 0 11.999c0 6.626 5.373 11.999 11.999 11.999 6.626 0 11.999-5.373 11.999-11.999C23.998 5.373 18.626 0 11.99 0zM11.99 21.998c-5.505 0-9.999-4.493-9.999-9.999 0-5.505 4.493-9.999 9.999-9.999 5.505 0 9.999 4.493 9.999 9.999 0 5.505-4.493 9.999-9.999 9.999z"/>
              <path d="M12.54 15.96h-1.38c-.25 0-.47-.07-.68-.2-.19-.14-.31-.34-.38-.55l-.35-1.21h-1.29l-.35 1.21c-.08.21-.21.41-.38.55-.19.13-.42.2-.68.2-.27 0-.52-.07-.74-.2-.22-.14-.41-.33-.55-.55-.14-.22-.21-.47-.21-.74 0-.27.07-.52.21-.74.14-.22.33-.41.55-.55.22-.14.47-.21.74-.21.27 0 .52.07.74.21.22.14.41.33.55.55.14.22.21.47.21.74 0 .27-.07.52-.21.74-.14.22-.33.41-.55.55-.22.14-.47.2-.74.2zM13.5 15.96c-.27 0-.52-.07-.74-.2-.22-.14-.41-.33-.55-.55-.14-.22-.21-.47-.21-.74 0-.27.07-.52.21-.74.14-.22.33-.41.55-.55.22-.14.47-.21.74-.21s.52.07.74.21c.22.14.41.33.55.55.14.22.21.47.21.74 0 .27-.07.52-.21.74-.14.22-.33.41-.55.55-.22.14-.47.2-.74.2zM14.87 15.96h-1.38c-.25 0-.47-.07-.68-.2-.19-.14-.31-.34-.38-.55l-.35-1.21h-1.29l-.35 1.21c-.08.21-.21.41-.38.55-.19.13-.42.2-.68.2-.27 0-.52-.07-.74-.2-.22-.14-.41-.33-.55-.55-.14-.22-.21-.47-.21-.74 0-.27.07-.52.21-.74.14-.22.33-.41.55-.55.22-.14.47-.21.74-.21.27 0 .52.07.74.21.22.14.41.33.55.55.14.22.21.47.21.74 0 .27-.07.52-.21.74-.14.22-.33.41-.55.55-.22.14-.47.2-.74.2z"/>
            </svg>
          </div>
          <div>
            <h1 className="text-xl font-bold">YouTube SubHelper</h1>
            <p className="text-gray-400">beomseo1210@gmail.com</p>
          </div>
        </div>
        <div className="flex items-center space-x-4">
          <Button variant="solid" size="sm">회원정보 수정</Button>
          <Button variant="solid" size="sm">로그아웃</Button>
        </div>
      </header>
      <div className="flex h-[80vh] bg-white">
        <div className="w-1/2 p-4">
          <div className="bg-white rounded-lg shadow-md p-4 border border-gray-300">
            <div className="flex items-center justify-between mb-2">
              <h2 className="text-xl font-bold">자막 편집</h2>
              <Button variant="outline" size="sm">점검</Button>
            </div>
            <div className="grid gap-4">
              <div>
                <Label htmlFor="content">영상 자막</Label>
                <Textarea id="content" rows={5} defaultValue="요약된 내용 1" />
              </div>
              <div className="relative">
                <Command>
                  <CommandInput placeholder="단어를 수정하세요..." />
                  <CommandList>
                    <CommandEmpty>No results found.</CommandEmpty>
                    <CommandGroup>
                      <CommandItem>
                        <Button variant="solid" size="sm" className="mr-2">수정</Button>
                        <span>단어 1</span>
                        <span className="ml-2 text-gray-500">(추천: 대체 단어 1)</span>
